import React from "react";
import './Team.css';
import { Secretariat } from './Dataset';
import { MdEmail } from 'react-icons/md';
import { FaLinkedinIn } from 'react-icons/fa';
import { FiGithub } from 'react-icons/fi';


export default function Team(){
    return(
           <>
           <div className="team-head">
           <h1>Secretariat</h1> <hr />
           </div>
           
        <div className="team-stats-card">
           {Secretariat.map((item) => {
               return(
                       <div key={item.id} className="team-stats">
                       <div className="img-hold">
                           <center><img className="team-img" src={item.imgsrc} alt="" /></center>
                           </div>
                       <h1>{item.name}</h1>
                       <h2 className="team-posting-sec">{item.post}</h2>
                       <div className="icons">
                        <span><a href="mailto:abs@pm.me"><MdEmail className="link-team"/> </a></span>
                        <span><a href="https:/github.com" target="_blank"><FaLinkedinIn className="link-team"/></a></span>
                        <span><a href="https:/github.com" target="_blank"><FiGithub className="link-team"/></a></span>
                       </div>
        </div>
               )
           })}
           </div> <hr/>
           <div className="team-stats-card2">
            {Secretariat.map((item => {
                return(
                    <div key={item.id} className="team-stats">
                        <div className="img-hold">
                           <center><img className="team-img" src={item.imgsrc} alt="" /></center>
                           </div>
                       <h1>{item.name}</h1>
                       <h2 className="team-posting-sec">{item.post}</h2>
                    </div>
                )
            }))}
           </div>
           </>
    )
}
